import React from 'react';


const About = () => {
  return (
    <section id="about" className="py-5 bg-light">
      <div className="container">
        <h1 className="display-4 text-center mb-4">About Us</h1>
        <p className="lead mb-4">
        Lund University Consulting Club is a student association dedicated to preparing its members for careers in the consulting industry. We aim to raise awareness of this profession by offering a variety of initiatives, such as case-solving, networking events, and resources in collaboration with consulting firms.
        </p>
        <p className="lead mb-4 ">
        By fostering a platform for discussion and knowledge exchange on consulting-related topics, we strive to build a network of highly talented and committed students. Our goal is to provide members with a competitive edge as they pursue careers in consulting. Through our activities, members gain valuable insights and bridge the gap between academic knowledge and practical experience.
        </p>
      </div>
    </section>
  );
};

export default About;
